// src/components/EventSearch.js

import React, { useState } from 'react';
import { TextField, Button, Typography, Dialog, DialogTitle, DialogContent, DialogActions } from '@mui/material';
import { styled } from '@mui/system';

// Styled container for the EventSearch component
const Container = styled('div')({
  padding: '20px',
  maxWidth: '800px',
  margin: '0 auto',
  backgroundColor: '#fff',
  borderRadius: '8px',
  boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)',
});

// Styled component for the event list
const EventList = styled('div')({
  marginTop: '20px',
});

export const EventSearch = ({ events }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [open, setOpen] = useState(false);
  const [newEvent, setNewEvent] = useState({ name: '', date: '', description: '' });

  // Filter events based on the search term
  const filteredEvents = events.filter(event =>
    event.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // Handle change in the search input
  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  // Handle click to open the create event dialog
  const handleOpen = () => {
    setOpen(true);
  };

  // Handle close of the create event dialog
  const handleClose = () => {
    setOpen(false);
  };

  // Handle change in new event fields
  const handleNewEventChange = (e) => {
    const { name, value } = e.target;
    setNewEvent({ ...newEvent, [name]: value });
  };

  // Handle create event submission
  const handleCreateEvent = () => {
    console.log('New Event Created:', newEvent);
    // You can add logic here to actually create the event (e.g., updating state or making an API call)
    handleClose();
  };

  return (
    <Container>
      <Typography variant="h5" gutterBottom>
        Search Events
      </Typography>
      <TextField
        label="Search Events"
        variant="outlined"
        fullWidth
        margin="normal"
        value={searchTerm}
        onChange={handleSearchChange}
      />
      <Button
        variant="contained"
        color="primary"
        onClick={handleOpen}
        style={{ marginTop: '20px' }}
      >
        Create Event
      </Button>
      
      {/* Display filtered events */}
      <EventList>
        <Typography variant="h6" gutterBottom>
          Event List
        </Typography>
        {filteredEvents.length > 0 ? (
          filteredEvents.map((event, index) => (
            <div key={index} style={{ marginBottom: '10px' }}>
              <Typography variant="body1">{event.name}</Typography>
              <Typography variant="body2" color="textSecondary">
                {event.date}
              </Typography>
              <Typography variant="body2">{event.description}</Typography>
            </div>
          ))
        ) : (
          <Typography variant="body1">No events found</Typography>
        )}
      </EventList>

      {/* Dialog for creating a new event */}
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Create New Event</DialogTitle>
        <DialogContent>
          <TextField
            label="Event Name"
            name="name"
            value={newEvent.name}
            onChange={handleNewEventChange}
            variant="outlined"
            fullWidth
            margin="normal"
          />
          <TextField
            label="Event Date"
            name="date"
            type="date"
            value={newEvent.date}
            onChange={handleNewEventChange}
            variant="outlined"
            fullWidth
            margin="normal"
            InputLabelProps={{ shrink: true }}
          />
          <TextField
            label="Event Description"
            name="description"
            value={newEvent.description}
            onChange={handleNewEventChange}
            variant="outlined"
            fullWidth
            margin="normal"
            multiline
            rows={4}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
          <Button onClick={handleCreateEvent} color="primary">
            Create
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default EventSearch;
